import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Profile navigation item
    await page.waitForSelector('.nav-item[data-view="profile"]');
    await page.click('.nav-item[data-view="profile"]');

    // Wait for profile view to load
    await page.waitForSelector('#profile-view.active', { timeout: 5000 }).catch(() => {
      throw new Error('Profile view did not load after navigation');
    });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_view.png'));

    // Extract profile information to verify success
    const profileInfo = await page.evaluate(() => {
      const username = document.querySelector('.user-profile .username')?.textContent;
      const handle = document.querySelector('.user-profile .user-handle')?.textContent;
      return { username, handle };
    });

    return {
      success: true,
      action: "Clicked on Profile navigation item and viewed current user's profile",
      extractedData: profileInfo,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for navigation menu to load
    await page.waitForSelector('.nav-menu', { timeout: 5000 });

    // Click profile navigation item using multiple selector strategies
    const profileSelector = '.nav-item[data-view="profile"]';
    await page.waitForSelector(profileSelector, { timeout: 3000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click.png'));

    // Click using different strategy than previous attempt
    await page.click(profileSelector);

    // Wait for profile view to load
    await page.waitForSelector('#profile-view.active', { timeout: 5000 });

    // Verify profile view is visible
    const isProfileVisible = await page.isVisible('#profile-view.active');
    if (!isProfileVisible) {
      throw new Error('Profile view not visible after navigation');
    }

    // Extract user profile data
    const userData = await page.evaluate(() => {
      const usernameEl = document.querySelector('.profile-username');
      const handleEl = document.querySelector('.profile-handle');
      return {
        username: usernameEl ? usernameEl.textContent : 'Not found',
        handle: handleEl ? handleEl.textContent : 'Not found',
        profileVisible: true
      };
    });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_view.png'));

    return {
      success: true,
      action: "Clicked on Profile navigation item and loaded user profile view",
      extractedData: userData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take error screenshot
    const errorScreenshot = path.join(screenshotsDir, 'error.png');
    await page.screenshot({ path: errorScreenshot });

    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [errorScreenshot],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for navigation menu to load
    await page.waitForSelector('.nav-menu', { state: 'visible' });

    // Click on Profile navigation item using data-view attribute
    const profileNavItem = await page.waitForSelector('.nav-item[data-view="profile"]');
    await profileNavItem.click();

    // Wait for profile view to become active
    await page.waitForSelector('#profile-view.active', { state: 'visible', timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_view.png'));

    // Extract profile data to verify success
    const profileData = await page.evaluate(() => {
      const usernameElement = document.querySelector('.profile-username');
      const handleElement = document.querySelector('.profile-handle');

      return {
        username: usernameElement ? usernameElement.textContent : null,
        handle: handleElement ? handleElement.textContent : null,
        profileActive: document.querySelector('#profile-view.active') !== null
      };
    });

    return {
      success: true,
      action: "Successfully clicked on Profile navigation item and viewed current user's profile",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to click on Profile navigation item",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
